  }, "'\uADF8 \uD544\uC694\uAC00 \uAE09\uBC15\uD558\uACE0 \uC911\uC694\uD558\uC9C0 \uC54A\uB2E4\uBA74 \uC544\uBB34 \uBB38\uC11C\uB3C4 \uB9CC\uB4E4\uC9C0 \uB9C8\uB77C'"), " \uB294 \uC5C9\uD074 \uBC25\uC758 \uBB38\uC11C\uD654 \uC81C 1\uBC95\uCE59\uC774\uB2E4."), mdx("p", null, "\uC2DC\uC2A4\uD15C\uC774 \uB108\uBB34\uB098 \uAC04\uB2E8\uD558\uB2E4\uBA74 \uC2DC\uC2A4\uD15C \uCEE8\uD14D\uC2A4\uD2B8 \uC815\uB3C4\uB9CC \uBB38\uC11C\uC5D0 \uBB18\uC0AC\uB418\uC5B4 \uC788\uC5B4\uB3C4 \uCDA9\uBD84\uD560 \uAC83\uC774\uB2E4. \uADF8\uB7EC\uB098 \uC870\uAE08 \uB354 \uBCF5\uC7A1\uD558\uB2E4\uBA74 \uC720\uC2A4\uCF00\uC774\uC2A4\uB098 \uB3C4\uBA54\uC778 \uBAA8\uB378\uC774\n\uBCC4\uB3C4\uB85C \uBB18\uC0AC\uB418\uC5B4\uC57C \uD560 \uAC83\uC774\uB2E4. \uD2B9\uC815 \uC0C1\uD669\uC774 \uB108\uBB34\uB098 \uBCF5\uC7A1\uD558\uACE0 \uB3D9\uC2DC\uC131\uACFC \uAD00\uB828\uD574\uC11C \uB2E4\uB978 \uAC1C\uBC1C\uC790\uB4E4\uC774 \uC54C\uC544\uB450\uC5B4\uC57C \uD558\uB294 \uB0B4\uC6A9\uC774 \uC788\uB2E4\uBA74\n\uC2DC\uD000\uC2A4\uB098 \uC2DC\uC2A4\uD15C \uC0C1\uD0DC\uB97C \uB530\uB85C \uBB18\uC0AC\uD558\uB294 \uAC8C \uC88B\uC744 \uAC83\uC774\uB2E4. \uD639\uC740, \uB3C4\uBA54\uC778 \uBAA8\uB378\uB9CC\uC73C\uB85C \uCDA9\uBD84\uD574\uC11C \uC720\uC2A4\uCF00\uC774\uC2A4\uC5D0 \uB300\uD55C \uC815\uC758\uAC00 \uD544\uC694\uAC00 \uC5C6\uC5B4\uC9C8 \uC218\uB3C4 \uC788\uB2E4."), mdx("p", null, "\uC774\uB7F0 \uC2DD\uC73C\uB85C \uC2DC\uC2A4\uD15C\uC758 \uBCF5\uC7A1\uB3C4 \uB54C\uBB38\uC5D0 \uBB38\uC11C\uD654\uC758 \uD544\uC694\uC131\uC774 \uB290\uAEF4\uC9C0\uAC70\uB098, Design Alternatives \uB97C \uB450\uACE0\n\uC65C \uC774 \uB514\uC790\uC778\uC744 \uC120\uD0DD\uD588\uB294\uC9C0\uC5D0 \uB300\uD55C \uAE30\uB85D\uC744 \uB0A8\uACA8\uC57C \uD560 \uB54C \uB4F1 \uC815\uB9D0 \uD544\uC694\uD560 \uB54C\uB9CC \uBB38\uC11C\uB85C \uB9CC\uB4E4\uC5B4\uC57C \uD55C\uB2E4. \uADF8\uB807\uC9C0 \uC54A\uC73C\uBA74 \uBB38\uC11C\uB97C \uC791\uC131\uD558\uB294 \uC2DC\uAC04\uACFC \uB178\uB825\n\uBFD0\uB9CC \uC544\uB2C8\uB77C, \uADF8\